import httpServer from "./http/server.js";
import { createLogger } from "./logger.js";

const logger = createLogger("src:index");

httpServer.on("ready", () => {
  logger.info("Http server is ready");
});

httpServer.start().then(() => {
  logger.info("Http server is started");
});

