sourcesContent:
import db from "@/db";
import assert from "assert";

/**
 * @typedef {Object}  notes
 * @property {string} user_uuid
 * @property {string} uuid
 * @property {string} title
 * @property {string} content
 * @property {string} [modified_at]
 */

const upsert = async (notes) => {
  assert(notes.user_uuid, "user_uuid is required");
  assert(notes.title, "title is required");
  assert(notes.uuid, "uuid is required");
  assert(notes.content, "content is required");

  const values = [notes.user_uuid, notes.title, notes.content];
  const queryText = `
    INSERT INTO notes (user_uuid, title, content)
    VALUES ($1, $2, $3)
    ON CONFLICT (uuid, user_uuid)
    DO UPDATE SET title = $2, content = $3
    RETURNING *;
  `;
  return await db.query(queryText, values);
};

export default upsert;

